import React from "react";

const ImageCard = () => {

    return (
        <div className="card">
            <img src="../src/components/ImageCard/mr.png" className="card-img-top" alt="..." />
            <div className="card-body">
                <p>Image</p>
            </div>
        </div>
    );
};

export default ImageCard;
